import "./porfolio.scss";

function Portfolio() {
  return (
    <div className="portfolio" id="portfolio">
      <h1>Portfolio</h1>
      <ul>Web App</ul>
      <ul>Mobile App</ul>
      <ul>Design</ul>
      <ul>Branding</ul>
    </div>
  );
}

export default Portfolio;
